$("#addCompetidor").click(function(){$("#formCompetidor .row:first-child").clone().appendTo("#formCompetidor")});
$("#analisar").click(function(){var d=[];$("#formCompetidor > .row").each(function(a,b){var c={};c.largada=$(b).children()[0].children[1].value;c.competidor=$(b).children()[1].children[1].value;c.tempo=$(b).children()[2].children[1].value;c.resultado="--";c.posicao=0;d.push(c)});d.sort(function(a,b){return parseInt(a.tempo)-parseInt(b.tempo)});winner=d[0];posicao=1;d.map(function(a,b){a.tempo==winner.tempo?(a.posicao=1,a.resultado="Vencedor(a)!"):a.posicao=posicao;posicao++});var e="";d.forEach(function(a){e+=
"<tr>        <td>"+a.posicao+"</td>        <td>"+a.largada+"</td>        <td>"+a.competidor+"</td>        <td>"+a.tempo+"</td>        <td>"+a.resultado+"</td>        </tr>"});$("#tableResult > tbody").html(e)});